import { container, title } from "../../assets/jss/material-kit-react.js";

const createMnemonicStyle = {
    container: {
        ...container,
        marginTop:"100px",
        marginLeft:"28px",
        color: "#FFFFFF",
        overflow: "hidden",
        position: "relative",
        display: "flex",
        alignItems: "center",
    },
};

export default createMnemonicStyle;
